    (function(){
        "use strict";
        const data = [
            {
                visible: true,
                name: 'viber',
                url : 'viber://chat?number=%2B380500101247', // + => %2B
                image: 'data:image/gif;base64,'
            },
            {
                visible: true,
                name: 'telegram',
                url:  'https://t.me/sandiservice',
                image: 'data:image/gif;base64,',
            }
        ];
        const HTMLElement = (data) => `<ul style="position: fixed;right: 20px; bottom: 100px; z-index: 999; list-style-type: none">
            ${data.map((item) => {
            if(item.visible) {
                    return `
                        <li>
                            <a href="${item.url}" target="_blank" title="${item.name}" style="
                                display: block;
                                width: 60px;
                                height: 60px;
                                margin-bottom: 15px;
                                font-size: 0;
                                background-image: url('${item.image}');
                                background-size: cover;">${item.name}</a>
                        </li>`
                }
            }).join('\n')}
            </ul>`;
        document.addEventListener('DOMContentLoaded', () => {
            document.body.insertAdjacentHTML("beforeend", HTMLElement(data));
        });
    }())
</script>

